    return (
      <div>
        {/* Add your content here */}
        <VisitorCounter /> {/* Added VisitorCounter here */}
        <HeroSection/>
        {/* Conditionally render the MusicPlayer component */}
        <MusicPlayer
          audioUrl="/song.mp3"
          songTitle="heaven can wait"
          artist="organ tapes"
        />
      </div>
    );
  };
  
